document.addEventListener('DOMContentLoaded', () => {
    // Product Image Gallery Functionality
    const mainImage = document.getElementById('mainImage');
    const thumbnailsContainer = document.querySelector('.thumbnails');
    let thumbnails = document.querySelectorAll('.thumbnail');

    // Color-to-images mapping (replace placeholder URLs with real images as needed)
    const colorImages = {
        "Navy Blue": [
            "data:image/jpeg;base64,",
            "data:image/jpeg;base64,",
            "data:image/jpeg;base64,",
            "data:image/jpeg;base64,",
            "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcStpcqs-FlWPHh1msRpsLujO20DJREvKL0AEA&s",
            "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRojIMu9WefzJ7TSXouWDWIsTdIe8_MBCnPew&s",
            "data:image/jpeg;base64,"
        ],
        "Black": [
            "data:image/jpeg;base64,",
            "data:image/jpeg;base64,",
            "data:image/jpeg;base64,",
            "data:image/jpeg;base64,"
        ],
        "Charcoal": [
            "data:image/jpeg;base64,",
            "data:image/jpeg;base64,",
            "data:image/jpeg;base64,",
            "data:image/jpeg;base64,"
        ],
        "Camel": [
            "data:image/jpeg;base64,",
            "data:image/jpeg;base64,",
            "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSzN98-8OZpKQduZywGFLu3fC6gmZCiV-myTA&s",
            "data:image/jpeg;base64,"
        ],
        "Sage": [
            "data:image/jpeg;base64,",
            "data:image/jpeg;base64,",
            "data:image/jpeg;base64,",
            "data:image/jpeg;base64,"
        ]
    };

    // Helper to update thumbnails and main image for a color
    function updateGalleryForColor(color) {
        const images = colorImages[color];
        if (!images) return;
        thumbnailsContainer.innerHTML = '';
        images.forEach((img, idx) => {
            const thumb = document.createElement('img');
            thumb.className = 'thumbnail' + (idx === 0 ? ' active' : '');
            thumb.src = img;
            thumb.alt = color + ' View ' + (idx + 1);
            thumb.setAttribute('data-image', img);
            thumb.addEventListener('click', function() {
                document.querySelectorAll('.thumbnail').forEach(t => t.classList.remove('active'));
                this.classList.add('active');
                mainImage.src = this.getAttribute('data-image');
            });
            thumbnailsContainer.appendChild(thumb);
        });
        mainImage.src = images[0];
    }

    // Initial thumbnail click binding
    function bindThumbnailClicks() {
        thumbnails = document.querySelectorAll('.thumbnail');
        thumbnails.forEach(thumbnail => {
            thumbnail.addEventListener('click', () => {
                const imageUrl = thumbnail.getAttribute('data-image');
                mainImage.src = imageUrl;
                thumbnails.forEach(thumb => thumb.classList.remove('active'));
                thumbnail.classList.add('active');
            });
        });
    }
    bindThumbnailClicks();

    // Size Chart Modal Functionality
    const sizeChartBtn = document.querySelector('.size-chart-btn');
    const sizeChartModal = document.getElementById('sizeChartModal');
    const closeModalBtns = document.querySelectorAll('.modal-close');
    const modalOverlays = document.querySelectorAll('.modal-overlay');

    sizeChartBtn.addEventListener('click', () => {
        sizeChartModal.classList.add('visible');
    });

    closeModalBtns.forEach(btn => {
        btn.addEventListener('click', () => {
            btn.closest('.modal-overlay').classList.remove('visible');
        });
    });

    modalOverlays.forEach(overlay => {
        overlay.addEventListener('click', (e) => {
            if (e.target === overlay) {
                overlay.classList.remove('visible');
            }
        });
    });

    document.addEventListener('keydown', (e) => {
        if (e.key === 'Escape') {
            modalOverlays.forEach(overlay => overlay.classList.remove('visible'));
        }
    });

    // Shopping Cart Modal Functionality
    const cartIcon = document.querySelector('.nav-icons .fa-shopping-cart');
    const cartModal = document.getElementById('cartModal');
    if (cartIcon && cartModal) {
        cartIcon.addEventListener('click', () => {
            displayCartItems();
            cartModal.classList.add('visible');
        });
    }

    // Cart functionality
    let cart = [];
    const cartItemsContainer = document.querySelector('.cart-items-container');
    const addToCartBtn = document.querySelector('.add-to-cart-btn');

    // Compare Colors Modal Functionality
    const compareColorsBtn = document.querySelector('.compare-colors-btn');
    const compareColorsModal = document.getElementById('compareColorsModal');
    const compareSelectBtns = document.querySelectorAll('.compare-select-btn');

    compareColorsBtn.addEventListener('click', () => {
        compareColorsModal.classList.add('visible');
    });

    compareSelectBtns.forEach(btn => {
        btn.addEventListener('click', () => {
            compareSelectBtns.forEach(b => b.classList.remove('selected'));
            btn.classList.add('selected');
            compareSelectBtns.forEach(b => b.textContent = 'Select');
            btn.textContent = 'Selected';
            // Optionally, update color selection in main product area
            const colorName = btn.closest('.compare-color-item').querySelector('h3').textContent.trim();
            // Find and trigger the color option in the main product area
            document.querySelectorAll('.color-option').forEach(opt => {
                if (opt.getAttribute('data-color') === colorName) {
                    opt.click();
                }
            });
        });
    });

    // Product Information Tabs Functionality
    const tabButtons = document.querySelectorAll('.tab-btn');
    const tabPanels = document.querySelectorAll('.tab-panel');

    tabButtons.forEach(button => {
        button.addEventListener('click', () => {
            const targetTab = button.getAttribute('data-tab');
            tabButtons.forEach(btn => btn.classList.remove('active'));
            tabPanels.forEach(panel => panel.classList.remove('active'));
            button.classList.add('active');
            document.getElementById(targetTab).classList.add('active');
        });
    });

    // Variant selection (size and color)
    const sizeOptions = document.querySelectorAll('.size-option');
    const colorOptions = document.querySelectorAll('.color-option');

    sizeOptions.forEach(option => {
        option.addEventListener('click', () => {
            sizeOptions.forEach(opt => opt.classList.remove('active'));
            option.classList.add('active');
            document.querySelector('.selected-size').textContent = option.textContent.trim();
        });
    });

    colorOptions.forEach(option => {
        option.addEventListener('click', () => {
            colorOptions.forEach(opt => opt.classList.remove('active'));
            option.classList.add('active');
            const color = option.getAttribute('data-color');
            document.querySelector('.selected-color').textContent = color;
            updateGalleryForColor(color);
        });
    });

    // Quantity Selector
    const quantityInput = document.querySelector('.quantity input');
    const minusBtn = document.querySelector('.quantity .minus');
    const plusBtn = document.querySelector('.quantity .plus');

    minusBtn.addEventListener('click', () => {
        let currentValue = parseInt(quantityInput.value);
        if (currentValue > 1) {
            quantityInput.value = currentValue - 1;
        }
    });

    plusBtn.addEventListener('click', () => {
        let currentValue = parseInt(quantityInput.value);
        quantityInput.value = currentValue + 1;
    });

    // Add to Cart functionality
    if (addToCartBtn) {
        addToCartBtn.addEventListener('click', () => {
            const productTitle = document.querySelector('.product-title').textContent;
            const productPrice = document.querySelector('.product-price .price').textContent;
            const selectedColorElement = document.querySelector('.color-option.active');
            const selectedSizeElement = document.querySelector('.size-option.active');
            const quantity = parseInt(quantityInput.value);

            const selectedColor = selectedColorElement ? selectedColorElement.getAttribute('data-color') : 'N/A';
            const selectedSize = selectedSizeElement ? selectedSizeElement.textContent.trim() : 'N/A';

            const product = {
                name: productTitle,
                price: productPrice,
                color: selectedColor,
                size: selectedSize,
                quantity: quantity
            };

            cart.push(product);
            console.log('Cart:', cart);

            alert(`${productTitle} added to cart!`);
        });
    }

    // Function to display cart items
    function displayCartItems() {
        cartItemsContainer.innerHTML = '';
        if (cart.length === 0) {
            cartItemsContainer.innerHTML = '<p>Your cart is currently empty.</p>';
            return;
        }
        cart.forEach(item => {
            const itemElement = document.createElement('div');
            itemElement.classList.add('cart-item');
            itemElement.innerHTML = `
                <p>${item.name} (Qty: ${item.quantity})</p>
                <p>Price: ${item.price}</p>
                <p>Color: ${item.color}, Size: ${item.size}</p>
                <hr>
            `;
            cartItemsContainer.appendChild(itemElement);
        });
    }
});